import './ChatHeader.css'
import { useNavigate } from 'react-router-dom';
function ChatHeader(){
    return(
        <div className="ChatHeader-container">
            <h3>CHAT APP</h3>
            <button onClick={() => navigate('/ChatHeader')}></button>
        </div>
    );
}

export default ChatHeader;
